import MyComponent from './MyComponent'

class App extends Component{
    constructor(props){
        super(props);

        this.state = {
            checked: true,
            title: 'Initial Title',
            name: 'Initial name',
            shouldRenderTitle: true
        };
    }

    renderTitle(){
        if(!this.state.shouldRenderTitle) return null

        return <h1>Title</h1>
    }

    render(){
        return (
            <div className= "App">
                {
                    this.state.shouldRenderTitle
                    ? <h1>Title</h1>
                    : null
                }
            </div>
        )
    }
}

export default App;
